import React, { useState, useEffect } from 'react';
import Link from './Link';

const LinksList = () => {
  const [links, setLinks] = useState([]);

  useEffect(() => {
    fetchLinksData();
  }, []);

  // Function to fetch data from the API and populate the table
  const fetchLinksData = () => {
    fetch('https://64bf88840d8e251fd110f977.mockapi.io/links', {
      method: 'GET',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then(res => {
        if (res.ok) {
          return res.json();
        }
        throw new Error('Failed to fetch data from the API.');
      })
      .then(linksData => {
        setLinks(linksData);
      })
      .catch(error => {
        console.error(error);
      });
  };

  // Function to add a new link to the API
  const addLinkToAPI = (linkData) => {
    fetch('https://64bf88840d8e251fd110f977.mockapi.io/links', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(linkData)
    })
      .then(res => {
        if (res.ok) {
          return res.json();
        }
        throw new Error('Failed to add data to the API.');
      })
      .then(newLink => {
        // Call fetchLinksData to refresh the table with the updated data
        fetchLinksData();
      })
      .catch(error => {
        console.error(error);
      });
  };


  const LinksList = () => {
    // ... Previous code ...
  
    const handleAddLink = (e) => {
      e.preventDefault();
  
      const name = e.target.elements.name.value;
      const description = e.target.elements.description.value;
      const product = e.target.elements.product.value;
      const form = e.target.elements.form.value;
  
      const newLink = {
        name: name,
        description: description,
        product: product,
        form: form
      };
  
      // Add the new link to the API and update the table
      addLinkToAPI(newLink);
  
      // Hide the modal
      document.getElementById('add-link-modal').classList.remove('show');
      document.getElementById('add-link-modal').style.display = 'none';
      document.body.classList.remove('modal-open');
      document.body.style.paddingRight = '0';
      const modalBackdrop = document.querySelector('.modal-backdrop');
      if (modalBackdrop) {
        document.body.removeChild(modalBackdrop);
      }
    };
  
    return (
      <div className="container">
        {/* ...Rest of the component code... */}
        <div className="modal" id="add-link-modal">
          {/* ...Rest of the modal code... */}
          <form id="add-link-form" onSubmit={handleAddLink}>
            {/* ...Rest of the form code... */}
          </form>
        </div>
        {/* ...Rest of the component code... */}
      </div>
    );
  };
  
  return (
    <div className="container">
      <h1 className="mt-4 mb-4">Links List</h1>

      <table className="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Description</th>
            <th>Product</th>
            <th>Form</th>
          </tr>
          <tr>
            <td>Name1</td>
            <td>Description1</td>
            <td>Product1</td>
            <td>Form1</td>
          </tr>
          <tr>
            <td>Name2</td>
            <td>Description2</td>
            <td>Product2</td>
            <td>Form2</td>
          </tr>
          <tr>
            <td>Name3</td>
            <td>Description3</td>
            <td>Product3</td>
            <td>Form3</td>
          </tr>
          <tr>
            <td>Name4</td>
            <td>Description4</td>
            <td>Product4</td>
            <td>Form4</td>
          </tr>
        </thead>
        <tbody id="links-table">
          {links.map((link, index) => (
            <Link key={index} link={link} />
          ))}
        </tbody>
      </table>

      <div className="text-center mb-4">
        <button
          className="btn btn-primary"
          data-toggle="modal"
          data-target="#add-link-modal"
        >
          + Add Link
        </button>
      </div>
    </div>
  );
};

export default LinksList;
